x3DSpaceNlsResources.Attribute.SF1411_11a_Require_Government_Financing? = 11a. ¿Requiere financiamiento del contrato por parte del gobierno para realizar el contrato propuesto? Si la respuesta es afirmativa, complete el punto 11b.
