x3DSpaceNlsResources.Attribute.SF1411_13_Proposal_Consistent_with_Established_Procedures = SF1411 13: Propuesta coherente con los procedimientos establecidos
x3DSpaceNlsResources.Attribute.SF1411_13_Proposal_Consistent_with_Established_Procedures? = 13. ¿Esta propuesta es coherente con las prácticas y los procedimientos de presupuesto y contabilidad establecidos y con los principios de coste de la normativa FAR Sección 31? Si la respuesta es negativa, explíquela.
