x3DSpaceNlsResources.Attribute.SF1411_14c_Notified_of_Noncompliance = SF1411 14c: Se notificó en cuanto al no cumplimiento.
x3DSpaceNlsResources.Attribute.SF1411_14c_Notified_of_Noncompliance? = ¿Se le ha notificado que no cumple o que puede no cumplir con la declaración de divulgación o las normas de contabilidad de costes? Si la respuesta es afirmativa, explíquelo en la propuesta.
x3DSpaceNlsResources.Attribute.SF1411_14d_Any_Aspect_Inconsistent_with_Disclosed_Practices = SF1411 14d: Cualquier aspecto no coherente con las prácticas divulgadas
